//    console.log(props.location.state.products)
let catProducts = props.location.state.products.map(p => <li>{p.name}</li>)
    return (
        <div>
        <div className="category-show-name">
            <h1>{name}</h1>
                <div>{catProducts}</div>


        </div>

        </div>
    )
}

